const RegulatoryAnalysis = () => {
  const classes = useStyles();
  const [loading, setLoading] = useState(false);
  const [tabValue, setTabValue] = useState(0);
  const [parameters, setParameters] = useState({
    smiles: '',
    drugClass: 'CNS stimulant',
    novelMechanism: false,
    orphanDrug: false,
    fastTrack: false,
    targetIndication: 'ADHD',
    primaryMechanism: 'dopamine/norepinephrine reuptake inhibition',
    syntheticSteps: 5,
    startingMaterialAvailability: 'standard',
    scaleRequirements: 'moderate'
  });
  const [analysisResults, setAnalysisResults] = useState(null);
  const [error, setError] = useState(null);
  
  const molecules = [
    { id: 1, name: 'Methylphenidate', smiles: 'CN(C)C(C1=CC=CC=C1)C(C)OC(=O)C' },
    { id: 2, name: 'Amphetamine', smiles: 'CC(N)CC1=CC=CC=C1' },
    { id: 3, name: 'Atomoxetine', smiles: 'CC(C)NCC1=CC=CC(OC2=CC=CC=C2)=C1' },
    { id: 4, name: 'Novel Amphetamine Derivative', smiles: 'CC(CC1=CC=C(C=C1)O)NC' }
  ];
  
  const drugClasses = [
    'CNS stimulant',
    'Non-stimulant',
    'Novel mechanism',
    'Prodrug'
  ];
  
  const targetIndications = [
    'ADHD',
    'ADHD with comorbid anxiety',
    'Adult ADHD',
    'Pediatric ADHD'
  ];
  
  const mechanisms = [
    'dopamine/norepinephrine reuptake inhibition',
    'norepinephrine reuptake inhibition',
    'dopamine/norepinephrine release',
    'alpha-2A adrenergic receptor agonism',
    'novel dual mechanism'
  ];
  
  const startingMaterialOptions = [
    { value: 'standard', label: 'Standard (Readily Available)' },
    { value: 'limited', label: 'Limited Availability' },
    { value: 'rare', label: 'Rare/Custom Synthesis Required' }
  ];
  
  const scaleRequirementOptions = [
    { value: 'low', label: 'Low (Lab Scale)' },
    { value: 'moderate', label: 'Moderate (Clinical Trial Supply)' },
    { value: 'high', label: 'High (Commercial Production)' },
    { value: 'very high', label: 'Very High (Mass Market)' }
  ];
  
  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };
  
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setParameters({
      ...parameters,
      [name]: value
    });
  };
  
  const handleSwitchChange = (e) => {
    const { name, checked } = e.target;
    setParameters({
      ...parameters,
      [name]: checked
    });
  };
  
  const handleReset = () => {
    setParameters({
      smiles: '',
      drugClass: 'CNS stimulant',
      novelMechanism: false,
      orphanDrug: false,
      fastTrack: false,
      targetIndication: 'ADHD',
      primaryMechanism: 'dopamine/norepinephrine reuptake inhibition',
      syntheticSteps: 5,
      startingMaterialAvailability: 'standard',
      scaleRequirements: 'moderate'
    });
    setAnalysisResults(null);
  };
  
  const handleRunAnalysis = async () => {
    if (!parameters.smiles) {
      setError('Please select a molecule');
      return;
    }
    
    setLoading(true);
    setError(null);
    
    try {
      // In a real implementation, this would make an API call to the backend
      await new Promise(resolve => setTimeout(resolve, 2000));
      
      // Sample analysis results
      setAnalysisResults({
        molecule: molecules.find(m => m.smiles === parameters.smiles),
        parameters: { ...parameters },
        regulatoryPathway: {
          preclinical: {
            duration: 18,
            durationRange: '15-21',
            description: 'In vitro and animal studies to evaluate safety and efficacy',
            percentage: 30
          },
          phaseI: {
            duration: 6,
            durationRange: '5-8',
            description: 'Safety, tolerability, pharmacokinetics in healthy volunteers',
            percentage: 10
          },
          phaseII: {
            duration: 12,
            durationRange: '10-16',
            description: 'Initial efficacy studies in patients with ADHD',
            percentage: 20
          },
          phaseIII: {
            duration: 24,
            durationRange: '20-30',
            description: 'Large-scale efficacy and safety studies',
            percentage: 40
          },
          fdaReview: {
            duration: 10,
            durationRange: '8-13',
            description: 'FDA review of New Drug Application (NDA)',
            percentage: 100
          },
          totalDuration: {
            months: 70,
            years: 5.8,
            range: '5-7 years'
          },
          specialDesignations: {
            orphanDrug: parameters.orphanDrug,
            fastTrack: parameters.fastTrack,
            breakthroughTherapy: false,
            acceleratedApproval: parameters.fastTrack && parameters.novelMechanism
          },
          riskFactors: [
            'CNS stimulant classification may require Schedule II controlled substance designation',
            parameters.novelMechanism ? 'Novel mechanism requires additional safety validation' : null,
            'Cardiovascular safety monitoring will be essential during clinical trials'
          ].filter(Boolean)
        },
        productionFeasibility: {
          technicalFeasibility: {
            score: 78,
            level: 'Moderate'
          },
          costFeasibility: {
            score: 65,
            level: 'Moderate'
          },
          timelineFeasibility: {
            score: 82,
            level: 'High'
          },
          scalability: {
            score: 70,
            level: 'Moderate'
          },
          overallFeasibility: {
            score: 74,
            level: 'Moderate'
          },
          syntheticRoute: {
            estimatedSteps: parameters.syntheticSteps,
            complexity: 'Moderate',
            startingMaterialAvailability: parameters.startingMaterialAvailability
          },
          productionMetrics: {
            estimatedCostPerKg: '$20,000 - $40,000 per kg',
            setupTimeline: '6 months',
            scaleUpTimeline: '9 months'
          },
          keyChallenges: [
            'Multi-step synthesis increases cumulative yield loss and quality control challenges',
            parameters.startingMaterialAvailability === 'limited' ? 'Limited availability of key starting materials may require alternative synthetic routes' : null,
            parameters.scaleRequirements === 'high' ? 'Large-scale production may require process optimization' : null
          ].filter(Boolean)
        },
        marketAnalysis: {
          targetIndication: parameters.targetIndication,
          marketOverview: {
            currentMarketSize: '$18.8 billion (2023)',
            cagr: '6.8%',
            patientPopulation: '366 million globally',
            majorMarkets: ['United States', 'Europe', 'Japan']
          },
          competitiveLandscape: [
            {
              name: 'Stimulants (Adderall, Ritalin, Vyvanse, etc.)',
              marketShare: '70%',
              growthRate: '5.2%',
              keyStrengths: ['Gold standard efficacy', 'Rapid onset'],
              keyWeaknesses: ['Abuse potential', 'Side effects', 'Controlled substance restrictions']
            },
            {
              name: 'Non-stimulants (Strattera, Intuniv, etc.)',
              marketShare: '25%',
              growthRate: '9.3%',
              keyStrengths: ['Lower abuse potential', 'Different side effect profile'],
              keyWeaknesses: ['Lower efficacy', 'Slower onset of action']
            }
          ],
          productOpportunity: {
            projectedMarketSizeAtLaunch: '$24.6 billion',
            potentialPeakMarketShare: `${parameters.novelMechanism ? '8' : '4'}% - ${parameters.novelMechanism ? '15' : '8'}%`,
            estimatedPeakAnnualSales: `$${parameters.novelMechanism ? '2.0' : '1.0'} - $${parameters.novelMechanism ? '3.7' : '2.0'} billion`,
            timeToBreakeven: `${parameters.novelMechanism ? 6 : 4} - ${parameters.novelMechanism ? 9 : 7} years post-launch`,
            marketPositioning: parameters.novelMechanism ? 'Differentiated product with novel mechanism' : 'Improved version of established drug class'
          },
          swotAnalysis: {
            strengths: [
              parameters.novelMechanism ? 'Novel mechanism of action differentiates from existing therapies' : 'Improved features over existing medications',
              'Potentially improved cardiovascular safety profile',
              'Possibly reduced abuse potential'
            ],
            weaknesses: [
              'New entrant to established market',
              'No brand recognition',
              parameters.novelMechanism ? 'Unproven mechanism in clinical practice' : null
            ].filter(Boolean),
            opportunities: [
              'Growing ADHD diagnosis rates',
              'Expanding adult ADHD market',
              'Concerns about stimulant abuse driving demand for alternatives',
              parameters.novelMechanism ? 'Potential for expansion to related indications' : null
            ].filter(Boolean),
            threats: [
              'Established competitor products with physician familiarity',
              'Potential for new competitive entrants',
              'Generic competition for existing products driving price pressure',
              'Regulatory changes affecting ADHD treatment landscape'
            ]
          }
        }
      });
    } catch (err) {
      console.error(err);
      setError('An error occurred during analysis. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className={classes.root}>
      <Typography variant="h4" className={classes.title}>
        Regulatory Analysis
      </Typography>
      
      <Grid container spacing={3}>
        <Grid item xs={12} md={4}>
          <Paper className={classes.paper}>
            <Typography variant="h6" gutterBottom>
              Analysis Parameters
            </Typography>
            
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="molecule-select-label">Select Molecule</InputLabel>
              <Select
                labelId="molecule-select-label"
                id="molecule-select"
                name="smiles"
                value={parameters.smiles}
                onChange={handleInputChange}
                label="Select Molecule"
              >
                <MenuItem value="">
                  <em>Select a molecule</em>
                </MenuItem>
                {molecules.map((molecule) => (
                  <MenuItem key={molecule.id} value={molecule.smiles}>
                    {molecule.name}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="drug-class-label">Drug Class</InputLabel>
              <Select
                labelId="drug-class-label"
                id="drug-class"
                name="drugClass"
                value={parameters.drugClass}
                onChange={handleInputChange}
                label="Drug Class"
              >
                {drugClasses.map((drugClass) => (
                  <MenuItem key={drugClass} value={drugClass}>
                    {drugClass}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="target-indication-label">Target Indication</InputLabel>
              <Select
                labelId="target-indication-label"
                id="target-indication"
                name="targetIndication"
                value={parameters.targetIndication}
                onChange={handleInputChange}
                label="Target Indication"
              >
                {targetIndications.map((indication) => (
                  <MenuItem key={indication} value={indication}>
                    {indication}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="primary-mechanism-label">Primary Mechanism</InputLabel>
              <Select
                labelId="primary-mechanism-label"
                id="primary-mechanism"
                name="primaryMechanism"
                value={parameters.primaryMechanism}
                onChange={handleInputChange}
                label="Primary Mechanism"
              >
                {mechanisms.map((mechanism) => (
                  <MenuItem key={mechanism} value={mechanism}>
                    {mechanism}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            
            <Typography variant="subtitle1" className={classes.sectionTitle}>
              Special Designations
            </Typography>
            
            <FormControlLabel
              control={
                <Switch
                  checked={parameters.novelMechanism}
                  onChange={handleSwitchChange}
                  name="novelMechanism"
                  color="primary"
                />
              }
              label="Novel Mechanism"
              className={classes.switchFormControl}
            />
            
            <FormControlLabel
              control={
                <Switch
                  checked={parameters.orphanDrug}
                  onChange={handleSwitchChange}
                  name="orphanDrug"
                  color="primary"
                />
              }
              label="Orphan Drug Designation"
              className={classes.switchFormControl}
            />
            
            <FormControlLabel
              control={
                <Switch
                  checked={parameters.fastTrack}
                  onChange={handleSwitchChange}
                  name="fastTrack"
                  color="primary"
                />
              }
              label="Fast Track Designation"
              className={classes.switchFormControl}
            />
            
            <Typography variant="subtitle1" className={classes.sectionTitle}>
              Production Parameters
            </Typography>
            
            <FormControl variant="outlined" className={classes.formControl}>
              <TextField
                label="Synthetic Steps"
                type="number"
                name="syntheticSteps"
                value={parameters.syntheticSteps}
                onChange={handleInputChange}
                variant="outlined"
                inputProps={{ min: 1, max: 20 }}
              />
            </FormControl>
            
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="starting-material-label">Starting Material Availability</InputLabel>
              <Select
                labelId="starting-material-label"
                id="starting-material"
                name="startingMaterialAvailability"
                value={parameters.startingMaterialAvailability}
                onChange={handleInputChange}
                label="Starting Material Availability"
              >
                {startingMaterialOptions.map((option) => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            
            <FormControl variant="outlined" className={classes.formControl}>
              <InputLabel id="scale-requirements-label">Scale Requirements</InputLabel>
              <Select
                labelId="scale-requirements-label"
                id="scale-requirements"
                name="scaleRequirements"
                value={parameters.scaleRequirements}
                onChange={handleInputChange}
                label="Scale Requirements"
              >
                {scaleRequirementOptions.map((option) => (
                  <MenuItem key={option.value} value={option.value}>
                    {option.label}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            
            {error && (
              <Alert severity="error" className={classes.alertMargin}>
                {error}
              </Alert>
            )}
            
            <div className={classes.buttonWrapper}>
              <Button
                variant="contained"
                color="primary"
                fullWidth
                onClick={handleRunAnalysis}
                disabled={loading}
              >
                Run Regulatory Analysis
              </Button>
              {loading && <CircularProgress size={24} className={classes.buttonProgress} />}
            </div>
            
            {analysisResults && (
              <Button
                variant="outlined"
                color="primary"
                fullWidth
                onClick={handleReset}
                style={{ marginTop: 16 }}
              >
                Reset
              </Button>
            )}
          </Paper>
        </Grid>
        
        <Grid item xs={12} md={8}>
          {loading ? (
            <div className={classes.progress}>
              <CircularProgress />
            </div>
          ) : analysisResults ? (
            <Paper className={classes.paper}>
              <Typography variant="h6" gutterBottom>
                Regulatory Analysis for {analysisResults.molecule.name}
              </Typography>
              
              <Tabs
                value={tabValue}
                onChange={handleTabChange}
                indicatorColor="primary"
                textColor="primary"
                variant="fullWidth"
                className={classes.tabs}
              >
                <Tab label="FDA Approval Pathway" icon={<TimelineIcon />} />
                <Tab label="Production Feasibility" icon={<BuildIcon />} />
                <Tab label="Market Analysis" icon={<TrendingUpIcon />} />
              </Tabs>
              
              <TabPanel value={tabValue} index={0}>
                <Grid container spacing={3}>
                  <Grid item xs={12}>
                    <TimelineChart data={analysisResults.regulatoryPathway} />
                  </Grid>
                  
                  <Grid item xs={12} md={6}>
                    <Typography variant="subtitle1" gutterBottom>
                      Timeline Breakdown
                    </Typography>
                    
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Preclinical</Typography>
                      <Typography>{analysisResults.regulatoryPathway.preclinical.durationRange} months</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Phase I</Typography>
                      <Typography>{analysisResults.regulatoryPathway.phaseI.durationRange} months</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Phase II</Typography>
                      <Typography>{analysisResults.regulatoryPathway.phaseII.durationRange} months</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Phase III</Typography>
                      <Typography>{analysisResults.regulatoryPathway.phaseIII.durationRange} months</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>FDA Review</Typography>
                      <Typography>{analysisResults.regulatoryPathway.fdaReview.durationRange} months</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel} style={{ fontWeight: 700 }}>Total Timeline</Typography>
                      <Typography style={{ fontWeight: 700 }}>{analysisResults.regulatoryPathway.totalDuration.range}</Typography>
                    </div>
                  </Grid>
                  
                  <Grid item xs={12} md={6}>
                    <Typography variant="subtitle1" gutterBottom>
                      Special Designations
                    </Typography>
                    
                    {Object.entries(analysisResults.regulatoryPathway.specialDesignations)
                      .filter(([_, value]) => value)
                      .map(([key]) => (
                        <Chip
                          key={key}
                          label={key.replace(/([A-Z])/g, ' $1').trim()}
                          className={classes.chip}
                          color="primary"
                        />
                      ))}
                      
                    {Object.values(analysisResults.regulatoryPathway.specialDesignations).every(v => !v) && (
                      <Typography variant="body2" color="textSecondary">
                        No special designations applicable
                      </Typography>
                    )}
                    
                    <Typography variant="subtitle1" className={classes.sectionTitle}>
                      Key Risk Factors
                    </Typography>
                    
                    {analysisResults.regulatoryPathway.riskFactors.map((risk, index) => (
                      <div key={index} className={classes.risk}>
                        <Typography className={classes.riskTitle}>
                          <AssignmentIcon className={classes.riskIcon} fontSize="small" />
                          Risk Factor
                        </Typography>
                        <Typography variant="body2">{risk}</Typography>
                      </div>
                    ))}
                  </Grid>
                </Grid>
              </TabPanel>
              
              <TabPanel value={tabValue} index={1}>
                <Grid container spacing={3}>
                  <Grid item xs={12}>
                    <FeasibilityChart data={analysisResults.productionFeasibility} />
                  </Grid>
                  
                  <Grid item xs={12} md={6}>
                    <Typography variant="subtitle1" gutterBottom>
                      Synthetic Route
                    </Typography>
                    
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Estimated Steps</Typography>
                      <Typography>{analysisResults.productionFeasibility.syntheticRoute.estimatedSteps}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Complexity</Typography>
                      <Typography>{analysisResults.productionFeasibility.syntheticRoute.complexity}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Starting Materials</Typography>
                      <Typography>
                        {startingMaterialOptions.find(
                          option => option.value === analysisResults.productionFeasibility.syntheticRoute.startingMaterialAvailability
                        )?.label || analysisResults.productionFeasibility.syntheticRoute.startingMaterialAvailability}
                      </Typography>
                    </div>
                    
                    <Typography variant="subtitle1" className={classes.sectionTitle}>
                      Production Metrics
                    </Typography>
                    
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Estimated Cost</Typography>
                      <Typography>{analysisResults.productionFeasibility.productionMetrics.estimatedCostPerKg}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Setup Timeline</Typography>
                      <Typography>{analysisResults.productionFeasibility.productionMetrics.setupTimeline}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Scale-up Timeline</Typography>
                      <Typography>{analysisResults.productionFeasibility.productionMetrics.scaleUpTimeline}</Typography>
                    </div>
                  </Grid>
                  
                  <Grid item xs={12} md={6}>
                    <Typography variant="subtitle1" gutterBottom>
                      Feasibility Scores
