                      <Typography className={classes.propertyLabel}>Cost Feasibility</Typography>
                      <Typography>{analysisResults.productionFeasibility.costFeasibility.score}/100 ({analysisResults.productionFeasibility.costFeasibility.level})</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Timeline Feasibility</Typography>
                      <Typography>{analysisResults.productionFeasibility.timelineFeasibility.score}/100 ({analysisResults.productionFeasibility.timelineFeasibility.level})</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Scalability</Typography>
                      <Typography>{analysisResults.productionFeasibility.scalability.score}/100 ({analysisResults.productionFeasibility.scalability.level})</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel} style={{ fontWeight: 700 }}>Overall Feasibility</Typography>
                      <Typography style={{ fontWeight: 700 }}>{analysisResults.productionFeasibility.overallFeasibility.score}/100 ({analysisResults.productionFeasibility.overallFeasibility.level})</Typography>
                    </div>
                    
                    <Typography variant="subtitle1" className={classes.sectionTitle}>
                      Key Challenges
                    </Typography>
                    
                    {analysisResults.productionFeasibility.keyChallenges.map((challenge, index) => (
                      <div key={index} className={classes.risk}>
                        <Typography variant="body2">{challenge}</Typography>
                      </div>
                    ))}
                  </Grid>
                </Grid>
              </TabPanel>
              
              <TabPanel value={tabValue} index={2}>
                <Grid container spacing={3}>
                  <Grid item xs={12}>
                    <MarketAnalysisChart data={analysisResults.marketAnalysis} />
                  </Grid>
                  
