                    <Typography variant="subtitle1" gutterBottom>
                      Market Overview
                    </Typography>
                    
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Current Market Size</Typography>
                      <Typography>{analysisResults.marketAnalysis.marketOverview.currentMarketSize}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>CAGR</Typography>
                      <Typography>{analysisResults.marketAnalysis.marketOverview.cagr}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Patient Population</Typography>
                      <Typography>{analysisResults.marketAnalysis.marketOverview.patientPopulation}</Typography>
                    </div>
                    
                    <Typography variant="subtitle1" className={classes.sectionTitle}>
                      Product Opportunity
                    </Typography>
                    
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Market Size at Launch</Typography>
                      <Typography>{analysisResults.marketAnalysis.productOpportunity.projectedMarketSizeAtLaunch}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Peak Market Share</Typography>
                      <Typography>{analysisResults.marketAnalysis.productOpportunity.potentialPeakMarketShare}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Peak Annual Sales</Typography>
                      <Typography>{analysisResults.marketAnalysis.productOpportunity.estimatedPeakAnnualSales}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Time to Breakeven</Typography>
                      <Typography>{analysisResults.marketAnalysis.productOpportunity.timeToBreakeven}</Typography>
                    </div>
                    <div className={classes.propertyItem}>
                      <Typography className={classes.propertyLabel}>Market Positioning</Typography>
                      <Typography>{analysisResults.marketAnalysis.productOpportunity.marketPositioning}</Typography>
                    </div>
                  </Grid>
                  
                  <Grid item xs={12} md={6}>
                    <Typography variant="subtitle1" gutterBottom>
                      SWOT Analysis
                    </Typography>
                    
                    <Typography variant="subtitle2" gutterBottom>
                      Strengths
                    </Typography>
                    <ul>
                      {analysisResults.marketAnalysis.swotAnalysis.strengths.map((strength, index) => (
                        <li key={index}>{strength}</li>
                      ))}
                    </ul>
                    
                    <Typography variant="subtitle2" gutterBottom>
                      Weaknesses
                    </Typography>
                    <ul>
                      {analysisResults.marketAnalysis.swotAnalysis.weaknesses.map((weakness, index) => (
                        <li key={index}>{weakness}</li>
                      ))}
                    </ul>
                    
                    <Typography variant="subtitle2" gutterBottom>
                      Opportunities
                    </Typography>
                    <ul>
                      {analysisResults.marketAnalysis.swotAnalysis.opportunities.map((opportunity, index) => (
                        <li key={index}>{opportunity}</li>
                      ))}
                    </ul>
                    
                    <Typography variant="subtitle2" gutterBottom>
                      Threats
                    </Typography>
                    <ul>
                      {analysisResults.marketAnalysis.swotAnalysis.threats.map((threat, index) => (
                        <li key={index}>{threat}</li>
                      ))}
                    </ul>
                  </Grid>
                </Grid>
              </TabPanel>
              
              <Divider className={classes.divider} />
              
              <Grid container spacing={2}>
                <Grid item xs={12} sm={6}>
                  <Button variant="outlined" color="primary" fullWidth>
                    Export Analysis
                  </Button>
                </Grid>
                <Grid item xs={12} sm={6}>
                  <Button variant="contained" color="primary" fullWidth>
                    Generate Full Report
                  </Button>
                </Grid>
              </Grid>
            </Paper>
          ) : (
            <Paper className={classes.paper} style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', minHeight: 500, flexDirection: 'column' }}>
              <TimelineIcon className={classes.emptyStateIcon} />
              <Typography variant="h6" color="textSecondary">
                No regulatory analysis generated
              </Typography>
              <Typography variant="body2" color="textSecondary">
                Set analysis parameters and click "Run Regulatory Analysis" to start
              </Typography>
            </Paper>
          )}
        </Grid>
      </Grid>
    </div>
  );
};

export default RegulatoryAnalysis;
